import React, {useState}from "react";
import { ThemeProvider } from '@material-ui/core/styles'
import CssBaseline from '@material-ui/core/CssBaseline'
import theme from '../../theme'
import Item from '../../components/item'
import { Button, CardContent, CardActionArea,
    Card, CardMedia, Grid, Paper, TextField } from '@material-ui/core';


function Login() {
    const [password, setPassword] = useState({})

    function handleInputChange(event) {
        const classes = useStyles();

        const { name, value } = event.target;
        setPassword({...password, [name]: value})
    };

    function handleFormSubmit(event) {
        event.preventDefault();
        if (password.username && password.password) {
            console.log("soop")
        }
    };

    return(
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <Item />
            <Paper className={classes.root}>
                <Grid container spacing={3}>
                    <Grid item xs={10}>
                        <CardContent color="secondary">
                            <div id="login">
                                <div id="mainSect">
                                    <div><h1>Login</h1>
                                    username
                                    <input 
                                        onChange={handleInputChange}
                                        name="username"
                                    />
                                    <br/>
                                    password
                                    <input
                                        onChange={handleInputChange}
                                        name="password"/>
                                        <br/>
                                        <Button
                                        disabled={!(password.username && password.password)}
                                        onClick={handleFormSubmit}>Submit
                                        </Button>
                                    </div>
                                    )
                                </div>
                            </div>
                        </CardContent>
                    </Grid>
                </Grid>
            </Paper>
        </ThemeProvider>
    )
}

export default Login
